// React
import React from "react";
import { Switch } from "react-router-dom";
// import { Route, Switch } from "react-router-dom";
// Components
import AuthenticatedRoute from "./components/AuthenticatedRoute";
import UnauthenticatedRoute from "./components/UnauthenticatedRoute";

// Pages
import Home from "./containers/Home";
import Welcome from "./containers/Welcome";
import NotFound from "./containers/NotFound";
import Login from "./containers/Login";
import Signup from "./containers/Signup";
import Routine from "./containers/Routine";
import Testing from "./containers/Testing";
import Manager from "./containers/Manager";
import MScreeningSummary from "./containers/MScreeningSummary";

export default function Routes() {
  return (
    <Switch>
      <AuthenticatedRoute exact path="/">
        <Home />
      </AuthenticatedRoute>
      <AuthenticatedRoute exact path="/mscreeningsummary">
        <MScreeningSummary />
      </AuthenticatedRoute>
      <AuthenticatedRoute exact path="/routine">
        <Routine />
      </AuthenticatedRoute>
      <AuthenticatedRoute exact path="/testing">
        <Testing />
      </AuthenticatedRoute>
      <AuthenticatedRoute exact path="/admins">
        <Manager />
      </AuthenticatedRoute>
      <UnauthenticatedRoute exact path="/welcome">
        <Welcome />
      </UnauthenticatedRoute>
      <UnauthenticatedRoute exact path="/login">
        <Login />
      </UnauthenticatedRoute>
      <UnauthenticatedRoute exact path="/signup">
        <Signup />
      </UnauthenticatedRoute>
      {/* Finally, catch all unmatched routes */}
      <UnauthenticatedRoute exact path="/NotFound">
        <NotFound />
      </UnauthenticatedRoute>
    </Switch>
  );
}
